import React, {useState} from "react";

export const Body = () => {

    const [Heading, setHeading] = useState('output');
    const [Fname, setFname] = useState();
    const [Lname, setLname] = useState();

    const Submit = () => {
        setHeading(setFname);
    }
    return(
        <>
            <form>
                <h2>This is {Heading}</h2>
                <input type="text" placeholder="enter fname" className="Fname" />
                <input type="text" placeholder="enter lname" className="Lname" />
                <button onClick={Submit}>Submit</button>
            </form>
        </>
    )
}
